<div class="entities" style="line-height: 2.5; direction: ltr">P62158 - mediated effects of loperamide on chloride transport by brush border membrane vesicles from human ileum . We investigated whether the synthetic opiate loperamide-HCl is able to regulate specific transport systems for sodium and chloride in brush border membrane vesicles ( BBMVs ) from human ileum and whether such activities are mediated by calcium / calmodulin . In BBMVs we studied Na + / H + antiport , Cl + / OH - antiport , Na + / Cl - cotransport , and the Cl - conductive pathway . Brush border membrane vesicles were incubated with 10 microM loperamide over 4 h at 5 degrees C before the uptake experiments . In ileal BBMVs , loperamide stimulated intravesicular accumulation of Na + in the presence of Cl - and vice versa . After 1 min of incubation , the stimulatory effect was 35 % + / - 5 % ( p less than 0.005 ) of the control without loperamide . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00836
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 also stimulated Cl - / OH - antiport by 30 % + / - 5 % ( p less than 0.005 ) in BBMVs of ileum . In addition , we studied the role of Ca2 + / calmodulin in the action of loperamide on chloride transport by human BBMVs . In loperamide-pretreated BBMVs , calmodulin activity was significantly decreased ( 12 + / - 2 vs . 38 + / - 4 pmol / mg protein ) . When loperamide-pretreated vesicles were incubated with 2 microM calcium ( free concentration ) plus 5 microM calmodulin for 1 h at 5 degrees C , complete inhibition of the stimulatory effect of loperamide on Cl - / OH - antiport and Na + / Cl - cotransport was observed . Increasing the Ca2 + / calmodulin activity of loperamide-pretreated BBMVs with 2 microM calcium plus 5 microM calmodulin led to a significant inhibition of Cl - / OH - antiport and Na + / Cl - cotransport by 40 % + / - 5 % ( p less than 0.005 ) .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Effects of external calcium on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . DB01373 is a known signalling molecule in eukaryotic cells and plays a central role in the regulation of many cellular processes . In the following study , we report on the effect of external calcium treatments on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . We observed that the intracellular calcium content of P . bainier 229-7 mycelia was increased in response to exposure to high external Ca ( 2 + ) concentrations . Both ginsenoside Rd biotransformation and β-glucosidase activity were both found to be dependent on the external calcium concentration . At an optimal Ca ( 2 + ) concentration of 45 mM , maximal ginsenoside Rd bioconversion rate of 92.44 % was observed and maximal β-glucosidase activity of 0.1778 U was reached in a 72 - h biotransformation . The Ca ( 2 + ) channel blocker Verapamil blocked the trans-membrane influx of calcium and decreased ginsenoside Rd biotransformatiom . In addition , β-glucosidase activity and ginsenoside Rd content decreased by 36.0 and 29.2 % respectively after a 72 - h incubation in the presence of 0.05 mM P62158 ( P62158 ) antagonist

</mark>

 ( DX - 88 ) , a plasma kallikrein inhibitor for the treatment of hereditary angioedema and the prevention of blood loss in on-pump cardiothoracic surgery . BACKGROUND :

 plays a major role in the contact ( kallikrein-kinin ) cascade producing bradykinin . Bradykinin is a vasodilator , which increases vascular permeability , activates inflammation and produces pain .

 is also crosslinked to the coagulation system and the complement cascade . OBJECTIVE :

 ( DX - 88 ) is a potent and specific inhibitor of plasma kallikrein .

 is a recombinantly produced and engineered small protein based on the first Kunitz domain of human tissue factor pathway inhibitor . It was identified through phage display technology . METHODS : The search terms ' ecallantide ' , ' DX - 88 ' and ' hereditary angioedema ' were entered into Pubmed / Medline , ClinicalTrials and Google . RESULTS / CONCLUSION : At present , the drug is being studied for two major indications . First , the results for the treatment of hereditary angioedema are promising . Second , a prospective randomised multi-centre trial for the reduction of blood loss during on-pump cardiothoracic surgery will be terminated in October 2008 .</div>

<h2 style="margin: 0">10</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Aripiprazole : a novel atypical antipsychotic drug with a uniquely robust pharmacology . Aripiprazole (

</mark>
 ) is an atypical antipsychotic drug that has been recently introduced for clinical use in the treatment of schizophrenia . Aripiprazole has a unique pharmacologic profile that includes partial agonism at several G-protein coupled receptors ( GPCRs ) [ especially dopamine ( D2 ) and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ] and antagonistic action at others ( especially 5 - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13049
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Clinical trials indicate that aripiprazole is effective in treating the positive and negative symptoms of schizophrenia . In short-term studies rapid onset of action ( within one week ) has been demonstrated . Preliminary data indicate that aripiprazole may also be effective in the treatment of manic symptoms of bipolar disorder . At recommended doses , aripiprazole appears to be safe and well tolerated in most adult patients with schizophrenia and schizoaffective disorder . There is only limited information available on the use of aripiprazole in children and adolescents , and pilot data suggest that a revised dosing strategy , based on weight , is indicated in this population . In the long-term studies , the use of aripiprazole was associated with continued efficacy , good compliance and increased time-to-relapse . Aripiprazole represents the first functionally selective atypical antipsychotic drug .</div>

<h2 style="margin: 0">13</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Aripiprazole : a review of its use in the treatment of manic episodes in adolescents with bipolar I disorder . Aripiprazole ( 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ( ® ) ) is an atypical antipsychotic that is widely used in the treatment of psychiatric conditions . Unlike other currently available atypical antipsychotics that primarily have varying degrees of dopamine D2 receptor antagonism , aripiprazole is a partial agonist at D2 and serotonin 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08908

</mark>
 receptors , which may explain differences in tolerability profiles . Recently in the EU , oral aripiprazole 10 mg once daily for 12 weeks was approved for the treatment of moderate to severe manic episodes in adolescents ( aged ≥ 13 years ) with bipolar I disorder . Approval was based on a phase 3 , 30 - week US trial in children and adolescents with bipolar I disorder experiencing manic or mixed episodes . Using trial data together with ancillary analyses , the European Medicines Agency concluded that aripiprazole 10 mg once daily for 12 weeks was effective in reducing symptoms of mania , but because of the high drop-out rate , efficacy over 30 weeks of treatment was not proven . Aripiprazole was generally well tolerated in the phase 3 trial . Ancillary analyses indicated that tolerability was less favourable in younger ( 10-12 years ) than in older ( ≥ 13 years ) subjects , and less favourable with the higher ( 30 mg / day ) than the lower dosage ( 10 mg / day ) . The drug is associated with sedation , weight gain and extrapyramidal symptoms ( EPS ) , although the incidence of EPS over 12 weeks was not significantly different between aripiprazole 10 mg / day and placebo . Data comparing the use of atypical antipsychotics in the treatment of mania in adolescents with bipolar I disorder are limited , but evidence shows that aripiprazole provides a valuable additional therapeutic option for use in this population .</div>
